import Helmet from "react-helmet";

export default () => {
  return (
    <div>
      <Helmet bodyAttributes={{ style: "background-color: black" }} />
      <h1>404 Page Not Found</h1>
      <p>Sorry, that page does not exist</p>
    </div>
  );
};
